import React from 'react';
import Book from './Book';

function BooksAvailable({ books }) {
  return (
    <>
      <h2>Books Available  now </h2>
       <div >
        {books.map((book) => (
          <Book
          image={book.imageUrl}
          name={book.title}
          author={book.author}
             />
        ))}
        </div>
    </>
  );
}

export default BooksAvailable;
